                continue
            nd = d + 1
            if dist[nr][nc] is None or nd < dist[nr][nc] or (
                nd == dist[nr][nc] and oc < labels[nr][nc]
            ):
                dist[nr][nc] = nd
                labels[nr][nc] = oc
                q.append((nr, nc))

    def nearest_outer_by_manhattan(r, c):
        best_oc = None
        best_d = 10**9
        for oc, plist in pos_by_color.items():
            for rr, cc in plist:
                d = abs(rr - r) + abs(cc - c)
                if d < best_d or (d == best_d and (best_oc is None or oc < best_oc)):
                    best_d = d
                    best_oc = oc
        return best_oc

    groups = {oc: [] for oc in outer_colors}
    for r, c in particles:
        oc = labels[r][c]
        if oc is None:
            oc = nearest_outer_by_manhattan(r, c)
        if oc in groups:
            groups[oc].append((r, c))

    # 5) Gravity/slide for each group along its direction
    def apply_gravity(particle_positions, dirvec):
        if not particle_positions:
            return set()
        dr, dc = dirvec
        pset = set(particle_positions)
        final = set()

        # Start points: cells whose predecessor along (-dr,-dc) is out of bounds
        for r in range(H):
            for c in range(W):
                pr, pc = r - dr, c - dc
                if 0 <= pr < H and 0 <= pc < W:
                    continue

                # Traverse the line starting at (r,c)
                coords = []
                rr, cc = r, c
                while 0 <= rr < H and 0 <= cc < W:
                    coords.append((rr, cc))
                    rr += dr
                    cc += dc

                seg = []
                cnt = 0
                for rr, cc in coords:
                    if base[rr][cc] != 0:
                        if cnt:
                            for pos in seg[-cnt:]:
                                final.add(pos)
                        seg = []
                        cnt = 0
                    else:
                        seg.append((rr, cc))
                        if (rr, cc) in pset:
                            cnt += 1
                if cnt:
                    for pos in seg[-cnt:]:
                        final.add(pos)

        return final

    out = [row[:] for row in base]
    for oc, plist in groups.items():
        final_positions = apply_gravity(plist, directions[oc])
        for r, c in final_positions:
            out[r][c] = 4

    return out
